import {React,useState} from 'react';
import axios from 'axios';


export default () =>{
    const[message, setMessage] = useState('');
    const[name, setName] = useState('');
    const[email, setEmail] = useState('')

    const formSubmit = (e, data) =>{
        console.log('nothing')
    }


    return(
        <div>
            <form className="form" onSubmit={(e) => {formSubmit(e, message, email, name)}}>
                <label class="message" htmlFor="message-input">Your Message</label>
                
                <textarea onChange={(e) => setMessage(e.target.value)} name="message" type="text" placeholder="Please write your message here" required/>

                <input onChange={(e) => setName(e.target.value)} name="name" type="text" placeholder="Your Name" required/>
                <div>
                    <input onChange={(e) => setEmail(e.target.value)} name="email" type="email" placeholder="your@email.com" required/>
                </div>
                <div className="btn btn-primary">
                    <button type="submit" className="button button-primary">Contact Me!</button>
                </div>
            </form>
        </div>
    )
}
